import React, { useEffect, useContext, useState } from "react";
import { Context } from "../..";
import Header from "../Header/Header";
import Footer from "../Footer/Footer";
import Buttons from "../Buttons/Buttons";
import ToTop from "../ToTop/ToTop";
import "./Polls.css";
import banner from "../../img/pools/policy/banner.png";
import { answer } from "../../queries/mainQuery";

const Policy = () => {
  const { user } = useContext(Context);
  const email = "titova.sofia.titova@gmail.com";
  const [answer1, setAnswer1] = useState(1);
  const [answer2, setAnswer2] = useState(1);
  const [answer3, setAnswer3] = useState(1);

  useEffect(() => {
    document.title = "Опросы по теме политики";
  }, []);

  const onSubmit = async (evt) => {
    evt.preventDefault();
    await answer({
      answer1,
      answer2,
      answer3,
      id_poll: 3,
    });
  };

  return (
    <div>
      <Header />
      <Buttons />
      <main className="main-container">
        {/* 1 секция баннер */}
        <section className="main-banner">
          <div className="banner">
            <div className="banner-title">
              <strong>Опросы по теме политики</strong>
            </div>
            <div className="banner-subtitle">
              <p>
                Опросы помогают лучше понять потребности и предпочтения людей в
                политических взглядах на ситуации в стране и мире
              </p>
            </div>
          </div>
          <div className="banner-img">
            <img src={banner} alt="" className="banner-img-img" />
          </div>
        </section>
        {/* 2 секция */}
        <section class="Opros_1">
          <form class="opros">
            <h3>Опрос №1</h3>
            <fieldset class="firstVopros">
              <legend>
                Откуда Вы чаще всего узнаете о новостях, событиях из жизни
                Вашего региона, страны, мира?
              </legend>
              <div>
                <input
                  type="radio"
                  id="q1a1"
                  name="q1"
                  value="1"
                  onChange={() => {
                    setAnswer1(1);
                  }}
                />
                <label for="q1a1">ТВ</label>
              </div>
              <div>
                <input
                  type="radio"
                  id="q1a2"
                  name="q1"
                  value="2"
                  onChange={() => {
                    setAnswer1(2);
                  }}
                />
                <label for="q1a2">Социальные сети</label>
              </div>
              <div>
                <input
                  type="radio"
                  id="q1a3"
                  name="q1"
                  value="1"
                  onChange={() => {
                    setAnswer1(1);
                  }}
                />
                <label for="q1a3">Другое</label>
              </div>
            </fieldset>
            <fieldset class="secondVopros">
              <legend>Вы интересуетесь или не интересуетесь политикой?</legend>
              <div>
                <input type="radio" id="q2a1" name="q2" value="Да" />
                <label for="q2a1">Да</label>
              </div>
              <div>
                <input type="radio" id="q2a2" name="q2" value="Нет" />
                <label for="q2a2">Нет</label>
              </div>
              <div>
                <input
                  type="radio"
                  id="q2a2"
                  name="q2"
                  value="Затрудняюсь ответить"
                />
                <label for="q2a2">Затрудняюсь ответить</label>
              </div>
            </fieldset>
            <fieldset class="thirdVopros">
              <legend>
                А раньше, 2-3 года назад, Вы интересовались политикой больше или
                меньше, чем сейчас?
              </legend>
              <div>
                <input type="radio" id="q3a1" name="q3" value="Больше" />
                <label for="q3a1">Больше</label>
              </div>
              <div>
                <input type="radio" id="q3a2" name="q3" value="Меньше" />
                <label for="q3a2">Меньше</label>
              </div>
              <div>
                <input type="radio" id="q3a3" name="q3" value="Не изменилось" />
                <label for="q3a3">Не изменилось</label>
              </div>
            </fieldset>
            <button id="submitFirst">Отправить</button>
          </form>
        </section>
      </main>
      <ToTop />
      <Footer />
    </div>
  );
};

export default Policy;
